import { Component } from "react";

class MyEventHandling extends Component {
    

         handleSubmit(e) {
          e.preventDefault();
          console.log('You clicked submit.');
        }
      
    render() {
        return (
            <div>
             Hello Events
                 <form onSubmit={this.handleSubmit}>
                 <button type="submit">Submit</button>
               </form>
           </div>
        )
    }
}
export default MyEventHandling;
